    <script type="text/javascript">
      google.charts.load('current', {'packages':['corechart']});
      google.charts.setOnLoadCallback(drawChart);

      function drawChart() {
        var data = new google.visualization.DataTable();
        data.addColumn('number');
        data.addColumn('number');
        window.electionData.forEach(item =>
          data.addRow([item.population, item.rd])
        );

        var options = {
          chart: {
            title: 'Population vs R/D ratio',
          },
          hAxis: {title: 'Population', logScale: false},
          vAxis: {title: 'R/D Ratio'},
          dataOpacity: 0.7,
        };

        var chart = new google.visualization.ScatterChart(document.getElementById('chart_div'));

        chart.draw(data, options);

        var chart2 = new google.visualization.ScatterChart(document.getElementById('log'));
        options.hAxis.logScale = true;
        options.chart.title = 'Population vs R/D ratio (logarithmic'
        chart2.draw(data, options);
      }
